import React from 'react';
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/Icon";
import * as CgIcons from "react-icons/cg";

function Header () {
    return (
        <AppBar position='static' color='#0000ff'>
            
            <Toolbar>
                {/* <IconButton
                    size="large"
                    edge="start"
                    color='#0000ff'
                    aria-label="menu"
                    sx={{mr:2}}>
                        
                    </IconButton> */}

                    <Typography className='titlename' variant='h6' component="div" sx={{ flexGrow: 1}}>Project Management System</Typography>
                    <IconButton color='inherit' className='search'><CgIcons.CgSearch/></IconButton>
                    <Button color="inherit">LogOut</Button>
            </Toolbar>
        </AppBar>
    )
}

export default Header;
